const IMAGE = (props) => {
    return ( 
        (() => {
            if(props.size === 1){
                return <img className="single-image" src={props.images} alt={props.alt} />
            } else {
                return (
                    <div className="image-gallery">

                    </div>
                )
            }
        })()
     );
}
 
export default IMAGE;
